import React from 'react';
//import ReactDOM from 'react-dom';
import { BrowserRouter, Route, Switch, Link } from 'react-router-dom';
import SignUp from './User/signUp.js';
import SignIn from './User/signIn.js';
import './app.css';

const App = () => {

  return (/*
    <div>
      <button onClick={userr}>Kayıt ol</button>
      <button onClick={event => window.location.href = '../user.js'}>try</button>

      <button>Giriş Yap</button>
    </div>*/
    <BrowserRouter>
      <Switch>
        <Route exact path="/">
          <Link to="/signUp" className="btn">Kaydol</Link><br />
          <Link to="/signIn" className="btn">Giriş</Link>
        </Route>
        element={<Home />}
        <Route exact path="/signUp">
          <SignUp />
        </Route>

        <Route exact path="/signIn">
          <SignIn />
        </Route>
      </Switch>
    </BrowserRouter>


  );
};



export default App;
